properties.description:
Immobiliare Atena propone in vendita un appartamento luminosissimo sito lungo la via Carpinetana, nel comune di Segni. Si tratta di un'immobile da ristrutturare, situato al primo piano e si compone di: soggiorno con cucina sperata, cinque camere e due bagni. 
-Possibilità di acquisto box auto;
-Ampia metratura;
-Tutti i locali sono finestrati;
-Ottima soluzione, adatta a famiglie numerose.

Per ulteriori informazioni visitate il nostro sito WWW. IMMOBILIAREATENA. IT, saremo lieti di aiutarvi.
Segni è un comune italiano della città metropolitana di Roma Capitale nel Lazio. È raggiungibile dalla stazione di: Colleferro-Segni-Paliano. Paesi limitrofi: Artena, Colleferro, Cori, Gavignano, Montelanico, Paliano.

RM10244

Mediazionecasa propone a Pomezia e più precisamente in Via Macerata in piccola palazzina un delizioso appartamento posto al primo piano senza ascensore di mq. 51 c. ca.
L'immobile è così composto:
- soggiorno con angolo cottura;
- disimpegno;
- bagno con finestra;
- camera matrimoniale;
- due balconi.
L'immobile è dotato di posto auto scoperto di proprietà all'interno del piazzale.
Molto luminoso, libero subito.

Il nostro Gruppo vanta un’esperienza ventennale nel settore dell’intermediazione, la nostra struttura si avvale di professionisti del settore per fornirti un servizio a 360 gradi dalla prima visita fino alla definitiva stipula del rogito notarile, collaboriamo con notaio, geometra, architetto, home-stager, arredatori, società di traslochi, società di ristrutturazioni per

Palazzina storica del 1920 su due livelli attualmente a reddito a 300 mensili, contratto 4+4 rinnovato nel novembre 2021.

L'immobile è così suddiviso:
- ingresso da via Roma con scala di accesso diretta al primo piano e portoncino di ingresso (montato nuovo nel 2020);
- piano 1: cucina abitabile con camino, salone con camino, bagno con doccia e cortile pavimentato interno 30mq di pertinenza esclusiva;
- piano 2: camera da letto padronale con vista Rocca, cameretta con affaccio sul cortile interno e bagno con vasca.

